import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import AdminDashboard from './pages/admin/Dashboard';
import GamesManagement from './pages/admin/GamesManagement';
import UsersManagement from './pages/admin/UsersManagement';
import Settings from './pages/admin/Settings';
import BranchesManagement from './pages/admin/BranchesManagement';
import ActivitiesLog from './pages/admin/ActivitiesLog';
import EmployeeDashboard from './pages/employee/Dashboard';
import RentalPage from './pages/RentalPage';
import Login from './pages/Login';
import { useAuth } from './context/AuthContext';

const ProtectedRoute = ({ children, roles }) => {
  const { user, loading } = useAuth();
  
  if (loading) {
    return <div className="loading-container">جاري التحميل...</div>;
  }
  
  if (!user) {
    return <Navigate to="/login" />;
  }
  
  if (roles && !roles.includes(user.role)) {
    return <Navigate to="/" />;
  }
  
  return children;
};

const AppRoutes = () => {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/login" element={<Login />} />
      
      {/* Admin Routes */}
      <Route path="/admin" element={
        <ProtectedRoute roles={['admin']}>
          <AdminDashboard />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/games" element={
        <ProtectedRoute roles={['admin', 'branch_manager']}>
          <GamesManagement />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/users" element={
        <ProtectedRoute roles={['admin']}>
          <UsersManagement />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/settings" element={
        <ProtectedRoute roles={['admin']}>
          <Settings />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/branches" element={
        <ProtectedRoute roles={['admin']}>
          <BranchesManagement />
        </ProtectedRoute>
      } />
      
      <Route path="/admin/activities" element={
        <ProtectedRoute roles={['admin']}>
          <ActivitiesLog />
        </ProtectedRoute>
      } />
      
      {/* Employee Routes */}
      <Route path="/employee" element={
        <ProtectedRoute roles={['employee', 'branch_manager', 'admin']}>
          <EmployeeDashboard />
        </ProtectedRoute>
      } />
      
      <Route path="/employee/rentals" element={
        <ProtectedRoute roles={['employee', 'branch_manager', 'admin']}>
          <RentalPage />
        </ProtectedRoute>
      } />
      
      {/* Default Route */}
      <Route path="/" element={
        <Navigate to="/admin" />
      } />
      
      {/* Catch all route */}
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>
  );
};

export default AppRoutes;
